script: |
  super -f text -I q205.spq | sort > q205.out

inputs:
  - name: q205.spq
    data: |
      SELECT - ( + 14 ) AS col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q205.out
    data: |
      -14
      -14
      -14
      -14
      -14
      -14
      -14
      -14
      -14
